// Código para InsertionSort

#include <stdio.h>

// Insertion Sort
void insertionSort(int arr[], int n) {
    int i, key, j;
    for (i = 1; i < n; i++) {
        key = arr[i];  // Elemento para ser inserido
        j = i - 1;

        // Move elementos de arr[0..i-1], que são maiores que 'key', para uma posição na frente
        while (j >= 0 && arr[j] > key) {
            arr[j + 1] = arr[j];
            j = j - 1;
        }
        arr[j + 1] = key;  // Coloca 'key' na posição correta
    }
}

// Função que imprime
void printar(int arr[], int size) {
    for (int i = 0; i < size; i++) {
        printf("%d ", arr[i]);
    }
    printf("\n");
}

